import { Injectable } from '@angular/core';
import User from "../../../shared/model/user";
import {HttpClient} from "@angular/common/http";
import {environment} from "../../../../environments/environment";
import {TranslateService} from "@ngx-translate/core";
import {take} from "rxjs/operators";
import {Observable} from "rxjs";

@Injectable({
  providedIn: 'root'
})
export class UsersService {

  constructor(
    private http: HttpClient,
    private translateService: TranslateService,
    ) { }

  createNewUser(user: User){
    const language = this.translateService.currentLang;
    return this.http.post(`${environment.apiUrl}/api/admin`,{...user,language}).pipe(take(1));
  }

  getAdminUsers(pageSize: number, pageNumber: number){
    return this.http.get<any>(`${environment.apiUrl}/api/admin?size=${pageSize}&pageNumber=${pageNumber}`).pipe(take(1));
  }

  findUserById(userId: any): Observable<User> {
    return this.http.get<User>(`${environment.apiUrl}/api/admin/${userId}`).pipe(take(1));
  }

  updateUser(userId: any, value: User) {
    return this.http.put<any>(`${environment.apiUrl}/api/admin/${userId}`,value);
  }
}

import {Component, EventEmitter, Input, OnInit, Output, SimpleChanges} from '@angular/core';
import {ActivatedRoute, Router} from "@angular/router";
import {FormBuilder, Validators} from "@angular/forms";
import {UsersService} from "../../services/users.service";
import {MatSnackBar} from "@angular/material/snack-bar";
import {TranslateService} from "@ngx-translate/core";

@Component({
  selector: 'app-user-form',
  templateUrl: './user-form.component.html',
  styleUrls: ['./user-form.component.scss']
})
export class UserFormComponent implements OnInit {

  isEdit = false;

  @Input() userId:number | null = null;
  @Input() createMode = true;

  @Output() save = new EventEmitter();
  alreadyRegisteredEmail = false;

  userForm = this.fb.group({
    email: ['',Validators.email],
    name: ['',Validators.required],
    isActive:['']
  });

  isLoading = false;

  constructor(
    private route: ActivatedRoute,
    private fb: FormBuilder,
    private userService: UsersService,
    private snackbar: MatSnackBar,
    private translateService: TranslateService,
    private router: Router
  ) { }

  ngOnInit(): void {
    this.route.params.subscribe(value => {
      if(value['id']){
        this.isEdit = true;
        this.userId = value['id'];
        this.userService.findUserById(this.userId).subscribe(({email,name,isActive})=>{
          this.userForm.setValue({email,name,isActive});
        });
      }
    })
  }

  ngOnChanges(changes: SimpleChanges){
    this.isEdit = !this.createMode;
    if(this.createMode){
      this.userForm.reset();
    }
    else{
      this.userService.findUserById(this.userId as number).subscribe( ({name,email}) => {
        this.userForm.setValue({name,email})
      })
    }

  }

  updateUser(){
    this.isLoading = true;
    this.userService.updateUser(this.userId,this.userForm.value).subscribe(success => {
      this.translateService.get('messages.userUpdated').subscribe( translation => {
        this.isLoading = false;
        this.save.emit();
        this.snackbar.open(translation,'Fechar').afterDismissed();
      })
    })
  }

  createUser(){
    this.isLoading = true;
    this.userService.createNewUser(this.userForm.value).subscribe(success => {
      this.translateService.get('messages.userCreated').subscribe( translation => {
        this.isLoading = false;
        this.save.emit();
        this.snackbar.open(translation,'Fechar');
      })
    }, error => {
      console.log(error);
      this.isLoading = false;
      switch (error.status){
        case 409:
          this.alreadyRegisteredEmail = true;
          break;
      }
    });
  }

}
<div class="default-padding full-width" fxLayout="column" fxLayoutAlign="center start">

  <h1 class="title">
    {{(isEdit?'titles.editUser' : 'titles.createUser') |translate}}
